import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Spinner } from 'react-bootstrap';

function App() {
  return (
    <iframe
    src="https://docs.google.com/forms/d/e/1FAIpQLSeloFue1VsUQ4Xau6eU7xdOn1UTDw9PxrakjrWT5L_BAhcHJg/viewform?embedded=true"
    width="100%"
    height="100vh"
    frameBorder="0"
    marginHeight="0"
    marginWidth="0"
    title="Google Form"
  >
    <Spinner animation="border" variant="info" />
  </iframe>
  );
}

export default App;
